import {useState, useEffect} from "react"
import axios from "axios"

export default function Todolist() {
    const TodoList = () => {
        const [todos, setTodos] = useState([]);
        const [newTodo, setNewTodo] = useState('');
        const [searchTerm, setSearchTerm] = useState('');
    }      

    useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      axios.get('http://localhost:3000/todos', { headers: { Authorization: token } })
        .then(res => setTodos(res.data));
    }
  }, []);


    const addTodo = () => {
    const token = localStorage.getItem('token');
    axios.post('http://localhost:3001/todos', { title: newTodo, completed: false }, { headers: { Authorization: token } })
      .then(response => setTodos([...todos, response.data]));
    setNewTodo('');
  };

  const deleteTodo = (id) => {
    const token = localStorage.getItem('token');
    axios.delete(`http://localhost:3001/todos/${id}`, { headers: { Authorization: token } })
      .then(() => setTodos(todos.filter(todo => todo.id !== id)));
  };

  const filteredTodos = searchTerm
    ? todos.filter(todo => todo.title.toLowerCase().includes(searchTerm.toLowerCase()))
    : todos;



    return (
            <div >

                {/* TodoList */}
                <div className="page-todolist">
                    <div class="page-title">
                        Todo 리스트
                        <a href="javascript:" className="btn-calen">달력아이콘</a>
                    </div>
                    <div className="page-contents">
                        <div className="data-day">2023.11.09(목)</div>

                        {/* Form */}

                        <form className="form-type">
                            <input type="text" placeholder="Todo 리스트를 추가해주세요 " className="form-input" value={newTodo} onChange={(e) => setNewTodo(e.target.value)} />
                            <button class="form-button" onClick={addTodo}>추가</button>
                        </form> 

                        {/* Form */}
                        <div className="form-type">
                            <input type="text" placeholder="Todo 리스트를 검색해주세요. " className="form-input" value={searchTerm} onChange={(e) => setSearchTerm(e.target.value)}/>
                            <a href="javascript:" class="form-button">검색</a>
                        </div>
                        {/* List */}
                        <div className="wrap-list">
                            {/* Data 가 없을 경우 */}
                            <div className="data-nodata">
                                Todo 리스트가 없습니다.<br/>
                                Todo 리스트를 추가해주세요.

                            </div>
                            <ul className="form-list">
                                {toDos.data && toDos.data.map((data)=>
                                <li  key={data.id}>
                                    <input type="checkbox"></input>
                                    <div className="data-list">
                                    {data.todo_content} 
                                    </div>
                                    <a haref="javascript:" class="form-button type-s-dark" onClick={(e) => this.deleteRow(toDos.data.id, e)}>삭제</a>

                                </li>
                                )}

                            </ul> 

                        </div>

                    </div>
                </div>

        </div>
        )


}


